import React from 'react';
import { Tooltip } from 'react-tooltip';

function Numbers() {
  const total = 43567;
  const urlList = [
    { name: 'Cancer', no: '456' },
    { name: 'Kidney Stone', no: '684' },
    { name: 'Hairfall', no: '930' },
    { name: 'Infertility', no: '265' },
    { name: 'Digestive Issues', no: '857' },
    { name: 'Migraine', no: '574' },
  ];
  const tool = [
    { first: 'Skin Cancer', second: '456' },
    { first: 'Blood Cancer', second: '456' },
    { first: 'Lung Cancer', second: '456' },
    { first: 'Mouth Cancer', second: '456' },
    { first: 'Breast Cancer', second: '456' },
    { first: 'All Cancer', second: '456' },
  ];

  return (
    <div className='py-20'>
      <div className="headers mt-4">Total Patients Cured<br/>{total}</div>
      <div className='row m-4' style={{ justifyContent: 'space-around' }}>
        {urlList.map((tempNo, index) => (
          <div key={index} className="no col-12 col-xl-4 mb-4 p-4 d-flex justify-content-center align-items-center">
            <h4>{tempNo.name}:<br />
              <div className='my-anchor-element d-flex justify-content-center align-items-center'>{tempNo.no}</div>
            </h4>
            <Tooltip id={`tooltip-${index}`} place="top">
              <p>{tool[0].first}</p>
            </Tooltip>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Numbers;
